social_posts.post_text:
I’m back in New York and beginning a new chapter because… 

I’m closing my chapter as a Brooklynette. 🖤🤍 The things I learned in this position transcend dance. I grew into a woman, established my career, and found a place to belong. Leaving is not easy, but there are many opportunities ahead and I’m ready to open space so someone else can experience the same magic I did. 

These photos are in order from each season’s photoshoot. (Notice 2020 is missing 😬)

@criscialong - You and @adarkirkham kept me in New York when I was about to give up. I will always be grateful for your support in my dancing, creating, and leadership. Every opportunity was a new challenge and I thank you for trusting me to step up to the plate. 

@shenayunique - You encouraged me to just be myself from the very start, before I even got the job. Your heart and spirit have gotten me through a lot of hard days. How amazing it’s been to have your presence around and to see you step into your role as boss lady and now as a mother. (P.s. Sorry I always cry when we talk) 

@asha.v.singh - You were my captain first, then my coach. Thank you for always being an example of a P-mode bad B. You were handed such an unexpected challenge becoming coach mid season, and you killed it. You have continued to kill it since then. I have learned so many leadership skills from you. Endless thanks 

@celineboom_ - We went through the trenches together, but we both have risen above. Thanks for always being your authentic self and showing me how to do the same. Can’t wait to see what new things you create for the team. Your creative mind is boundless!! 

@kris10_greto + @kaylacruz_ - My lifelines this past year 🖤🤍 Nothing can prepare you for being a captain of the Brooklynettes. I’m so happy I got to share my last season leading along side you two. Cheers to new adventures! 

My Teammates and Team Hype - You are all amazingly and individually gifted. Thank you for listening to me and respecting me. Thank you for letting me pray with you for the past 6 years. That won’t stop just because I’m not there. Keep being amazing. Truly, they can’t do it like we do. 

#BrooklynetteMelissa signing off. 📵
